import Fuente from './Fuente';
import "../styles/Noticia.css"

const Noticia = (props) => {
  return(
    <div>
      <div className="noticia-titulo">{props.titulo}</div>
      <Fuente fuente={props.fuente} fecha={props.fecha}/>
      <div className="noticia-body">{props.body}</div>  
      <img src={require(`../images/${props.foto}.jpg`)} alt="Foto"/>
    </div>
  );
};


export default Noticia;
